import { Outlet, Link } from "react-router-dom";

const Layout = () => {
  return (
    <>
        <div>
            <Link to="/">Home</Link>
            <Link to="/search">Search</Link>
            <Link to="/ironman">IronMan</Link>
        </div>
      <Outlet />
    </>
  )
};

export default Layout;
